import React from 'react';

class Header extends Component {
    state = {  }
    render() { 
        return ( 
            <div class="headerBanner">
                <div class="headerLeft">
                    <h3>this is a header</h3>
                </div>
                <div class="headerRight">
                    <a class="headerRightOptions" href="/" class="headerLinks">HOME</a>
                    <a class="headerRightOptions" href="/user/login" class="headerLinks">LOGIN</a>
                    <a class="headerRightOptions" href="/user/create" class="headerLinks">SIGN UP</a>
                    <a class="headerUser" href="/user/home">username</a>
                </div>
            </div>            
         );
    }
}

export default Header;
